import React from 'react'
import { LeftDiv } from '../SignIn/SignIn'

const RightDiv = () => {
    return(
        <div className='flex w-[60%] h-full justify-center p-10'>
            <div className='w-[90%] flex flex-col items-center justify-center'>
                <div className='mx-auto flex-col flex items-center bg-slate-400'>
                    <h3 className='text-4xl font-semibold'>OTP</h3>
                    <p className='w-[80%] text-sm'>Please check your email for security code</p>
                </div>
            </div>
        </div>
    )
}

const OTP = () => {
    return (
        <div className='flex align-middle'>
            <LeftDiv/>
            <RightDiv/>
        </div>
    )
}

export default OTP
